INSERT INTO shop VALUES ('faf08f184f69691e014f698429e3000d', '2015-08-26 18:18:33', '', '2015-09-21 11:32:04', '吉芬（JEFEN），是为28至40岁风华正茂的女性所设计的高贵服装。\r\n它选用的材料主要是意大利的毛、丝、麻等天然素材，并有最先进的面料加工工艺制成，所以，在面料上体现了它的高贵性。在设计上，在简约的风范之下融合进了时尚流行的基本元素；在实用的基础上，不失性感；特别是版型上，更多考虑到28岁以上女性体型变化的诸多特点，在欧码版型的基础上，经过对东方女性体型的深入研究，而做出的设计。\r\n它以时尚、高贵、独特的文化内涵引导人们高品位的生活方式。它不仅是一件衣服，而且通过时尚的款式设计，精良的手工制做工艺及中西合璧、无与伦比的板型制造所带来的穿着效果，充分体现穿着JEFEN品牌所带给人们的风采与自豪。', 'JEFEN', null, 'faf08f184fb5e098014fb66177cf0015', '10000', '01');
