INSERT INTO shop VALUES ('faf08f184faafe6b014fb04be1fd016a', '2015-09-09 12:10:07', '', '2015-09-16 11:55:51', '佳美口腔隶属于北京佳美医院管理有限责任公司，成立于1993年，是国内第一个连锁经营的大型现代化口腔门诊体系。\r\n佳美采用当今世界口腔医疗前沿技术，拥有系列自主知识产权和国内高水平医疗队伍，突破了传统的国内口腔医疗服务模式，以超过二十年的从业背景和雄厚的医护技术资源，开展口腔内科、口腔外科、口腔正畸、烤瓷牙、种植牙等业务。\r\n佳美以先进的医疗设备、人性化的服务、科学安全的消毒技术等特点受到广大患者的认可，已成为业界领先的知名品牌。\r\n佳美目前在北京、上海、大连多个中心城市建立了数十家直营连锁门诊，终身会员突破百万。 ', '佳美口腔', null, 'faf08f184fcf1fdd014fd44b5634000d', '10500', '12');
INSERT INTO shop VALUES ('faf08f184fb13015014fb143cc1c0019', '2015-09-09 16:40:54', '', '2015-09-10 17:56:54', '北京光之树瑜伽中心是京城第一家艾扬格瑜伽中心，提供了综合的瑜伽学习课程，包括常规课程，密集课程，工作坊，以及艾扬格瑜伽教师培训，瑜伽的习练遵循艾扬格大师的方式。我们的目标是去鼓励学生以艾扬格瑜伽的精神去习练，让身体轻盈健康，心理健康并获得灵性的成长。 \r\n光之树艾扬格瑜伽中心教师团队的老师都参加过严格的艾扬格教师培训，并获得教学认证资格。他们自律谦卑，并坚持每日习练，除了这些持续的教师培训课程以外，教师们会规律的去印度艾扬格学院及瑞诗凯诗参加更深入的学习。\r\n正因为如此老师们将会给中心的学生的高质量的指导和个人的关注。\r\n我们的中心位于北京市朝阳区东四环霄云桥芳园南里9号院7号楼108底商，场馆面积达600平。辅助工具配备齐全。环境简洁宽敞明亮。\r\n光之树，愿成为你瑜伽之路上的那盏明灯，照亮旅途中的每个暗角。', '光之树瑜伽中心', null, 'faf08f184fb5e098014fb66393fd0016', '10000', '13');
INSERT INTO shop VALUES ('faf08f184fb6d0c2014fba2033980002', '2015-09-11 09:58:36', '', '2015-09-11 11:54:53', '谦亨，创建于2006年，借鉴英伦贵族美学理念，针对东方人的气质，专研适合东方高端人士的美发造型，为每一位高端贵宾打造高贵、优雅、独特的专属风格。谦亨的每一家门店都精雕细琢，拥有独特的装修风格，始终为客户提供物超所值的享受和服务，因此赢得了北京众多高端人士的欢迎！谦亨，北京受高端人士欢迎的美发造型品牌，每年接待6万人次的塔尖高端人士，欢迎您的光临！', '谦亨SPA会所', null, 'faf08f184fb6d0c2014fba2033820001', '10000', '14');
