INSERT INTO shop VALUES ('faf08f184fbb13d7014fbb20d1ce0009', '2015-09-11 14:38:54', '', '2015-09-11 14:38:54', '美丽田园（BEAUTY FARM）美容发展有限公司始创于一九九三年，是中国著名美容美体SPA连锁中心之一，总部设于上海，目前已有113家分店。店内采用会员制管理，根据顾客皮肤和身体状况，建立针对性护肤方案。美丽田园于2013年12月全资收购了世界顶尖健发权威品牌——史云逊健发中心的中国区整体业务。', '美丽田园', null, 'faf08f184fbb13d7014fbb20d1b50008', '10000', '16');
INSERT INTO shop VALUES ('faf08f184fbb2400014fbb3317860001', '2015-09-11 14:58:51', '', '2015-09-11 15:02:16', '東田造型是中国著名国家级造型师、著名时尚人士李东田先生于1999年精心创建，是国内一流的时尚化妆造型机构。工作室拥有中国十大青年时尚化妆师等国内一批著名化妆师，在服 装模特、广告、时尚摄影、演艺明星、MTV制作、歌舞表演等领域具有国际影响。旗下著名造型师唐毅（巴黎欧莱雅中国区首席特约造型师）、壮志、君君、摄影师袁峰等均是国内造型界著名锋尚人物。东田造型公司位于北京建外SOHO西区15号楼3层，拥有优越的地理位置和一流的造型设计水平，被誉为“中国流行时尚的风向标”,在业内的“领头羊”的位置越加明显。', '東田造型', null, 'faf08f184fbb2400014fbb3317670000', '10000', '17');
