INSERT INTO shop VALUES ('faf08f184fbb2400014fbb9c41290006', '2015-09-11 16:53:43', '', '2015-09-11 17:00:13', '北京布瑞琳洗染服务有限公司创立于2009年，作为中国高端专业洗护行业的创立者，布瑞琳以中国洗护行业产业升级为己任，采用国际领先的节能环保设备、先进的工艺技术、中央工厂规模化洗护方式、在商超和社区广泛布局，运用互联网工具，为广大中、高端客户群体提供高效、便捷的专业洗护服务 \r\n从服饰的专业洗护到家庭整体洗护，布瑞琳以精品成衣洗护，窗帘、沙发、地毯为主的上门家纺洗护及皮草、手袋、鞋类养护三大项目，打造极致用户体验的个性化洗护服务。', '布瑞琳', null, 'faf08f184fbb2400014fbba23272000c', '10000', '18');
